import React, { useEffect, useState } from "react";
import { UserOutlined } from "@ant-design/icons";
import { Layout, Menu, theme, Breadcrumb, Button, Avatar, Dropdown, Space } from "antd";
import { useNavigate, Link } from "react-router-dom";
import "./Dashboard.css";
import Content from "../../components/admin/Content";

const { Header, Sider, Content: AntContent } = Layout;

function getItem(label, key, icon, children, type) {
  return {
    key,
    icon,
    children,
    label,
    type,
  };
}

const Dashboard = () => {
  const {
    token: { colorBgContainer },
  } = theme.useToken();
  const navigate = useNavigate();

  const [userName, setUserName] = useState("");
  const [collapsed, setCollapsed] = useState(false);

  useEffect(() => {
    const token = localStorage.getItem("token");
    const isAdmin = JSON.parse(token).roleNames.includes("ROLE_ADMIN");

    if (!isAdmin) {
      navigate("/admin/login");
    } else {
      setUserName(JSON.parse(token).userName);
    }
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/admin/login");
  };

  const menu = (
    <Menu>
      <Menu.Item key="0">
        <Link to="#">Edit Profile</Link>
      </Menu.Item>
      <Menu.Item key="1">
        <Link to="#">Change Password</Link>
      </Menu.Item>
    </Menu>
  );

  const toggleCollapsed = () => {
    setCollapsed(!collapsed);
  };

  return (
    <Layout style={{ minHeight: "100vh" }}>
      <Sider
        breakpoint="lg"
        collapsedWidth="0"
        onBreakpoint={(broken) => {
          if (broken) {
            setCollapsed(true);
          } else {
            setCollapsed(false);
          }
        }}
        trigger={null}
        collapsible
        collapsed={collapsed}
      >
        <div className="logo" />
        <Menu theme="dark" mode="inline" defaultSelectedKeys={["1"]}>
          {/* Menu items */}
        </Menu>
      </Sider>
      <Layout>
        <Header style={{ background: "#fff", padding: 0 }}>
          <Button type="primary" onClick={toggleCollapsed} style={{ marginBottom: 16 }}>
            {collapsed ? "Menu" : "Collapse"}
          </Button>
          <Dropdown overlay={menu} trigger={["click"]}>
            <Button onClick={(e) => e.preventDefault()} style={{ float: "right" }}>
              <Space>
                <Avatar style={{ backgroundColor: "#87d068" }} icon={<UserOutlined />} />
                <span>{userName}</span>
              </Space>
            </Button>
          </Dropdown>
          <Button type="text" onClick={handleLogout} style={{ float: "right", marginRight: 10 }}>
            <span className="material-symbols-outlined">logout</span>
          </Button>
        </Header>
        <AntContent style={{ margin: "16px" }}>
          <Breadcrumb style={{ margin: "16px 0" }}>
            <Breadcrumb.Item>Admin</Breadcrumb.Item>
            <Breadcrumb.Item>
              <Link to="/admin/dashboard">Dashboard</Link>
            </Breadcrumb.Item>
          </Breadcrumb>
          <Content colorBgContainer={colorBgContainer} />
        </AntContent>
      </Layout>
    </Layout>
  );
};

export default Dashboard;
